def sum_digits(n):
    s = 0
    while n > 0:
        s += n % 10
        n = n // 10
    return s


def max_sum_digits(x):
    max_sum = 0
    for i in range(1, x + 1):
        if sum_digits(i) > max_sum:
            max_sum = sum_digits(i)
    return max_sum


